function leftContainerJSON(t){$("#drop-masterlist .label, #leftContainer .title .label").append(t.title),$("#drop-masterlist .count, #leftContainer .title .count").append(" ("+t.items.length+")"),$(t.items).each(function(){var t;t='<article class="list-object">',t+="   <aside>"+this.subheader+"</aside>",t+="   <header><h2>"+this.header+"</h2><h3>"+this.kpi+"</h3></header>",t+="   <footer>",t+='       <ul class="switch">',t+='          <li class="more"><button type="button">more</button></li>',t+='          <li class="less"><button type="button">less</button></li>',t+="       </ul>",t+='       <ul class="attributes">',t+="           <li>"+this.attribute1+"</li>",t+='<li class="right">'+this.attribute2+"</li>",t+="           <li>"+this.attribute3+"</li>",t+='           <li class="right">'+this.attribute4+"</li>",t+="       </ul>",t+="   </footer >",t+="</article >",$(t).appendTo("#leftContainer .content"),this.header.length<26?$("<option>"+this.header+"</option>").appendTo("#drop-masterlist select"):$("<option>"+this.header.substr(0,25)+"...</option>").appendTo("#drop-masterlist select")})}function getLeftContainerData(t){$.ajax({dataType:"json",url:t+"/src/json/leftContainer.min.json",success:leftContainerJSON,error:function(){console.log("No left container JSON found.")},complete:function(){console.log("Left container JSON loaded.")}})}